import react from "react";
import { useParams } from "react-router";

const FiveDayForecast = (props) => {

    const params = useParams();

    console.log(params.cityId);
    let data;
    //const response = await fetch(`https://api.openweathermap.org/data/2.5/weather?q=${enteredCity}&units=${unit}&appid=5a4e05662564bdefbc9d1b3d65c255f0`);
    data = fetch(`https://api.openweathermap.org/data/2.5/forecast?q=${params.cityId}&appid=5a4e05662564bdefbc9d1b3d65c255f0`);


    return(
        <div>
            <div>Ovo je petodnevna prognoza</div>
            <p>{params.cityId}</p>
            <div>{data}</div>
        </div>
    );
}

export default FiveDayForecast;
